import React from 'react';
import Navbar from '../navSection/Navbar';
import SearchBar from '../component/SearchBar';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import Button from ''

function Product() {
  return (
    <div style={{position:"relative"}}>
      <Navbar />
      <div>
        <div className='my- m-auto d-none d-md-block' style={{width:"30%", position:"absolute", top:0, left:"30%", }}>
          <SearchBar/>
        </div>
        <div className='align-items-center  d-flex d-md-none' style={{width:"80%", position:"absolute", top:0, left:0}}>
          <SearchBar/>
          <Buton><SearchOutlinedIcon className='text-white'/></Buton>
        </div>
      </div>
    </div>
  );
}

export default Product;
